#!/usr/bin/env python3

import sys

p = int(sys.stdin.readline())
a = [int(x) for x in sys.stdin.readline().split()]

b = [0] * (p - 1)

for i in range(p - 1):
    for j in range(p - 1, -1, -1):
        b[i] += a[j] * (p ** j)
        b[i] %= p

print(*b)
